import styled from 'styled-components';

export const TopBar = styled.div`
    background: #3B707C;
    padding: 20px;
`;

export const List = styled.ul`
    list-style: none;
    display: flex;

    > li {
        border: 1px solid #fff;
        margin-right: 10px;
    }
`;
